INSERT INTO `pages` (`id`, `title_ar`, `title_en`, `desc_ar`, `desc_en`, `content_ar`, `content_en`, `created_at`, `updated_at`, `type`, `picture`) VALUES
(2, 'الشروط و الأحكام', 'Terms of service', 'الشروط و الأحكام', 'Terms of service', '<p>لكي يشعر الأفراد بالراحة عند مشاركة معلوماتهم الشخصية على الإنترنت ، يجب أن يكون هناك نوع من المسؤولية القانونية على الشركات لحماية تلك البيانات وإبقاء المستخدمين على علم بحالة وصحة معلوماتهم. أدركت البلدان في جميع أنحاء العالم الحاجة إلى حماية بيانات مواطنيها وخصوصيتهم. يتعين على الشركات والمواقع الإلكترونية التي تجمع معلومات العملاء و / أو تعالجها نشر اتفاقية سياسة الخصوصية والالتزام بها. قامت غالبية الدول بالفعل بسن قوانين لحماية أمن بيانات المستخدمين وخصوصيتهم. تتطلب هذه القوانين من الشركات الحصول على موافقة صريحة من المستخدمين الذين ستقوم بتخزين بياناتهم أو معالجتها. أدركت البلدان في جميع أنحاء العالم الحاجة إلى حماية بيانات مواطنيها وخصوصيتهم. يتعين على الشركات والمواقع الإلكترونية التي تجمع معلومات العملاء و / أو تعالجها نشر اتفاقية سياسة الخصوصية والالتزام بها. قامت غالبية الدول بالفعل بسن قوانين لحماية أمن بيانات المستخدمين وخصوصيتهم. تتطلب هذه القوانين من الشركات الحصول على موافقة صريحة من المستخدمين الذين ستقوم بتخزين بياناتهم أو معالجتها.</p>', 'required requiFor individuals to feel comfortable sharing their personal information on the internet, there should be some sort of legal responsibility on businesses to protect that data and keep the users informed about the status and health of their information.\r\n\r\nCountries around the world have realized the need to protect their citizens\' data and privacy. Businesses and websites that collect and/or process customer information are required to publish and abide by a Privacy Policy agreement.\r\n\r\nA majority of countries have already enacted laws to protect their users\' data security and privacy. These laws require businesses to obtain explicit consent from users whose data they will store or process.red required', '2021-06-16 09:38:02', '2023-09-12 11:11:24', 'footer', '2022/06/14/GCbZiRsf1ICQAzJRJCKna3W4XEpM5g6VkXwP4Vr7NEJq5gdOkq.png'),
(3, 'سياسة الخصوصية', 'Privacy policy', 'سياسة الخصوصية', 'Privacy policy', ' لكي يشعر الأفراد بالراحة عند مشاركة معلوماتهم الشخصية على الإنترنت ، يجب أن يكون هناك نوع من المسؤولية القانونية على الشركات لحماية تلك البيانات وإبقاء المستخدمين على علم بحالة وصحة معلوماتهم.\n\nأدركت البلدان في جميع أنحاء العالم الحاجة إلى حماية بيانات مواطنيها وخصوصيتهم. يتعين على الشركات والمواقع الإلكترونية التي تجمع معلومات العملاء و / أو تعالجها نشر اتفاقية سياسة الخصوصية والالتزام بها.\n\nقامت غالبية الدول بالفعل بسن قوانين لحماية أمن بيانات المستخدمين وخصوصيتهم. تتطلب هذه القوانين من الشركات الحصول على موافقة صريحة من المستخدمين الذين ستقوم بتخزين بياناتهم أو معالجتها.  \n\nأدركت البلدان في جميع أنحاء العالم الحاجة إلى حماية بيانات مواطنيها وخصوصيتهم. يتعين على الشركات والمواقع الإلكترونية التي تجمع معلومات العملاء و / أو تعالجها نشر اتفاقية سياسة الخصوصية والالتزام بها.\n\nقامت غالبية الدول بالفعل بسن قوانين لحماية أمن بيانات المستخدمين وخصوصيتهم. تتطلب هذه القوانين من الشركات الحصول على موافقة صريحة من المستخدمين الذين ستقوم بتخزين بياناتهم أو معالجتها.', 'required requiFor individuals to feel comfortable sharing their personal information on the internet, there should be some sort of legal responsibility on businesses to protect that data and keep the users informed about the status and health of their information.\r\n\r\nCountries around the world have realized the need to protect their citizens\' data and privacy. Businesses and websites that collect and/or process customer information are required to publish and abide by a Privacy Policy agreement.\r\n\r\nA majority of countries have already enacted laws to protect their users\' data security and privacy. These laws require businesses to obtain explicit consent from users whose data they will store or process.red required', '2021-06-16 09:38:02', '2023-03-30 14:34:24', 'footer', '2022/06/14/GCbZiRsf1ICQAzJRJCKna3W4XEpM5g6VkXwP4Vr7NEJq5gdOkq.png'),
(9, 'كيف تعمل', 'How does it work', 'وصف كيف تعمل', 'how does it work description', 'محتوى بالعربية لكيف تعمل', 'How does it work content in English', '2022-06-27 10:05:41', '2022-06-27 10:05:41', 'navbar', '2022/06/27/xmHqhaVmoTW6YdnUzV19WwEVF2jBoG446v7Hf3PEqCQh7XjdZw.png'),
(10, 'من نحن', 'About us', 'اكتشف الحلول المناسبة لسيارتك!', 'about us', '<p>خلافاَ للإعتقاد السائد فإن لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له يغامضة في نص لوريم إيبسوم وهي \"consectetur\"، وخلال تتبعه لهذهde Finibus Bonorum et Malorum الميلاد. هذا الكتاب هو بمثابة مقالة علمية مطولة في نظرية الأخلاق، وكان له شعبية كبيرة في عصر النهضة. السطر الأول</p><p>خلافاَ للإعتقاد السائد فإن لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له يغامضة في نص لوريم إيبسوم وهي نظرية الأخلاق، وكان له شعبية كبيرة في عص ر لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له النهضة. السطر الأول&nbsp;</p><p><br><br>&nbsp;</p>', '<p>خلافاَ للإعتقاد السائد فإن لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له يغامضة في نص لوريم إيبسوم وهي \"consectetur\"، وخلال تتبعه لهذهde Finibus Bonorum et Malorum الميلاد. هذا الكتاب هو بمثابة مقالة علمية مطولة في نظرية الأخلاق، وكان له شعبية كبيرة في عصر النهضة. السطر الأول</p><p>خلافاَ للإعتقاد السائد فإن لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له يغامضة في نص لوريم إيبسوم وهي نظرية الأخلاق، وكان له شعبية كبيرة في عص ر لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له النهضة. السطر الأول&nbsp;</p><p><br><br>&nbsp;</p>', '2023-09-25 11:36:54', '2023-10-03 10:22:40', 'navbar', '2023/09/25/LHtHO61sUr36ex5DBSPLFiJXo40C5VelblWFlp2J780k1FXpcq.jpg'),
(11, 'خدماتنا', 'Services', 'تاكد ان سيارتك فى ايد امينه\n', 'تاكد ان سيارتك فى ايد امينه\n', '<p>يعتبر بوجى من افضل المواقع لخدمتك وراحتك وانت فى بيتك حيث انه هو ولعرض مزيد من الخدمات الخاصة بسيارتكم حيث توجد العديد من الخدمات لذلك من فضلك توجه الى الخدمة التى تريدها من القائمة من</p><p>&nbsp;</p>', '<p>يعتبر بوجى من افضل المواقع لخدمتك وراحتك وانت فى بيتك حيث انه هو ولعرض مزيد من الخدمات الخاصة بسيارتكم حيث توجد العديد من الخدمات لذلك من فضلك توجه الى الخدمة التى تريدها من القائمة من</p><p>&nbsp;</p>', '2023-09-27 13:09:51', '2023-09-27 13:09:51', NULL, '2023/09/27/AMR6Ek84D9sINygSdirdG1kaRblghmnrB3pZ6hkNgij1LN4xLO.png');

